import React from 'react'
import UserCrypto from '../components/UserCrypto'

class UserCryptosContainer extends React.Component {

getPrices = () => {
  const values = []
  this.props.userCryptos.map((crypto)=> {
    values.push(crypto.price)
  })
  console.log(values)
  const arrSum = values => values.reduce((a,b) => a + b, 0)
}


  render(){
    return(
      <div className="userCryptos">
      <h1>My Cryptocurrencies</h1>
      <button className="CCbutton" onClick={this.props.returnToHomepageFromCryptosContainers}>Return to homepage</button>
      {console.log(+this.props.userCryptos[0].price + +this.props.userCryptos[1].price)}
      {this.getPrices()}

      <div>
      {this.props.userCryptos.map((crypto)=>{
        return <UserCrypto
                key={"user-"+crypto.name+"-"+crypto.id}
                toggleCryptos={this.props.toggleCryptos}
                crypto={crypto}
                setCurrentCrypto={this.props.setCurrentCrypto}
                />
      })}
      </div>
      </div>
    )
  }

}

export default UserCryptosContainer
